import React from 'react';
import {
  Container,
  Typography,
  Box,
  Paper,
  Grid,
  Chip,
  Button,
  Stepper,
  Step,
  StepLabel,
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import ReceiptIcon from '@mui/icons-material/Receipt';
import LocalShippingIcon from '@mui/icons-material/LocalShipping';
import PaymentIcon from '@mui/icons-material/Payment';

const Orders = () => {
  const navigate = useNavigate();

  // Mock orders data - in real app, this would come from an API
  const orders = [
    {
      id: 1,
      carName: 'BMW 4 Series',
      orderDate: '2023-07-15',
      price: '$28,700',
      status: 'Processing',
      image: 'https://images.unsplash.com/photo-1555215695-3004980ad54e?auto=format&fit=crop&w=400',
      orderNumber: 'ORD-2023-001',
      paymentStatus: 'Paid',
      currentStep: 1,
    },
    {
      id: 2,
      carName: 'Mercedes AMG GT',
      orderDate: '2023-07-10',
      price: '$35,900',
      status: 'Delivered',
      image: 'https://images.unsplash.com/photo-1617531653332-bd46c24f2068?auto=format&fit=crop&w=400',
      orderNumber: 'ORD-2023-002',
      paymentStatus: 'Paid',
      currentStep: 3,
    },
    {
      id: 3,
      carName: 'Audi RS7',
      orderDate: '2023-07-05',
      price: '$32,500',
      status: 'Confirmed',
      image: 'https://images.unsplash.com/photo-1614200187524-dc4b892acf16?auto=format&fit=crop&w=400',
      orderNumber: 'ORD-2023-003',
      paymentStatus: 'Paid',
      currentStep: 2,
    },
  ];

  const getStatusColor = (status) => {
    switch (status) {
      case 'Processing':
        return 'warning';
      case 'Confirmed':
        return 'info';
      case 'Delivered':
        return 'success';
      default:
        return 'default';
    }
  };

  const orderSteps = ['Order Placed', 'Processing', 'Delivered'];

  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      <Typography variant="h4" gutterBottom>
        My Orders
      </Typography>

      <Grid container spacing={3}>
        {orders.map((order) => (
          <Grid item xs={12} key={order.id}>
            <Paper
              elevation={2}
              sx={{
                p: 3,
                borderRadius: 2,
                '&:hover': { transform: 'translateY(-2px)', transition: 'transform 0.2s' },
              }}
            >
              <Grid container spacing={3}>
                <Grid item xs={12} sm={3}>
                  <img
                    src={order.image}
                    alt={order.carName}
                    style={{
                      width: '100%',
                      height: '120px',
                      objectFit: 'cover',
                      borderRadius: '8px',
                    }}
                  />
                </Grid>

                <Grid item xs={12} sm={6}>
                  <Typography variant="h6" gutterBottom>
                    {order.carName}
                  </Typography>

                  <Box sx={{ display: 'flex', alignItems: 'center', gap: 2, mb: 1 }}>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                      <ReceiptIcon color="action" fontSize="small" />
                      <Typography variant="body2" color="text.secondary">
                        Order #{order.orderNumber}
                      </Typography>
                    </Box>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                      <LocalShippingIcon color="action" fontSize="small" />
                      <Typography variant="body2" color="text.secondary">
                        {order.orderDate}
                      </Typography>
                    </Box>
                    <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                      <PaymentIcon color="action" fontSize="small" />
                      <Typography variant="body2" color="text.secondary">
                        {order.paymentStatus}
                      </Typography>
                    </Box>
                  </Box>

                  <Stepper activeStep={order.currentStep} alternativeLabel size="small">
                    {orderSteps.map((label) => (
                      <Step key={label}>
                        <StepLabel>{label}</StepLabel>
                      </Step>
                    ))}
                  </Stepper>
                </Grid>

                <Grid item xs={12} sm={3} sx={{ textAlign: 'right' }}>
                  <Typography variant="h6" color="primary.main" gutterBottom>
                    {order.price}
                  </Typography>

                  <Chip
                    label={order.status}
                    color={getStatusColor(order.status)}
                    sx={{ mb: 2 }}
                  />

                  <Box>
                    <Button
                      variant="outlined"
                      size="small"
                      onClick={() => navigate(`/car/${order.id}`)}
                      sx={{ mr: 1 }}
                    >
                      View Car
                    </Button>
                    <Button
                      variant="contained"
                      size="small"
                      color="primary"
                      onClick={() => console.log('Track order:', order.id)}
                    >
                      Track Order
                    </Button>
                  </Box>
                </Grid>
              </Grid>
            </Paper>
          </Grid>
        ))}
      </Grid>

      {orders.length === 0 && (
        <Box
          sx={{
            textAlign: 'center',
            py: 8,
          }}
        >
          <Typography variant="h6" color="text.secondary" gutterBottom>
            No orders found
          </Typography>
          <Button
            variant="contained"
            onClick={() => navigate('/')}
            sx={{ mt: 2 }}
          >
            Browse Cars
          </Button>
        </Box>
      )}
    </Container>
  );
};

export default Orders;
